Description ♂ 
♀
.

Head
(
Figs 379–380
). Ground-colour black. Frons at broadest point 0.43 (
♂
) or 0.46 (
♀
), at lunula 0.27 (
♂
) or 0.34 (
♀
), of maximum head-width (frontal view). Fronto-orbital plate yellowish-white pruinose, brownish above, and subshining at vertex; parafacial and face yellowish-white pruinose, usually and mostly overlaid with brown; gena and lower half of occiput silvery pruinose, occiput with an undusted patch at mid length; vertex broadly shining, especially behind ocellar tubercle. Frontal triangle narrow, dull, brown. Parafacial very narrow, less than half width of postpedicel; setulose along whole length. Antenna black, except tip of pedicel and base of postpedicel which are conspicuously orange; postpedicel 2.5 (
♂
) or 2.3 (
♀
) times as long as broad, falling short of mouth-margin by 0.8 (
♂
) or 0.6 (
♀
) its length. Arista long-plumose, the hairing at widest point 2.0 (
♂
) or 2.2 (
♀
) times width of postpedicel. Vibrissa strong. Gena narrow, 0.06 of vertical eye-length; genal setae strong, sparse. Proboscis relatively short and stout. Palpus yellow, greatly swollen in apical half (
Fig. 381
).

Wing
. Usually clear, but sometimes strikingly infuscated, to varying degrees and to a varying extent. Tegula and basicosta yellow. Crossvein r-m placed slightly beyond the point where vein R1 enters costa; dm-cu straight (
♂
) or slightly sinuous (
♀
), longer than apical section of vein CuA1. Vein M running straight to wing-margin. Calypters white, with creamy margins. Knob of haltere dark brown.
